import React from 'react';
import _ from 'lodash';
import { withStyles } from '@material-ui/core';
import Row from '../Row/index';

const List = ({ classes, movieList }) => {
  return (
    <div>
      {_.isEmpty(movieList) ?
        <div className={classes.emptyListMessage}>
          Aucun film dans votre liste
        </div>
        :
        <div>
          <Row movies={movieList.slice(0,5)} />
          <Row movies={movieList.slice(5,10)} />
          <Row movies={movieList.slice(10,15)} />
          <Row movies={movieList.slice(15,20)} />
          <Row movies={movieList.slice(20,25)} />
          <Row movies={movieList.slice(25,30)} />
          <Row movies={movieList.slice(30,35)} />
          <Row movies={movieList.slice(35,40)} />
          <Row movies={movieList.slice(40,45)} />
          <Row movies={movieList.slice(45,50)} />
          <Row movies={movieList.slice(50,55)} />
          <Row movies={movieList.slice(55,60)} />
          <Row movies={movieList.slice(60,65)} />
          <Row movies={movieList.slice(65,70)} />
          <Row movies={movieList.slice(70,75)} />
          <Row movies={movieList.slice(75,80)} />
          <Row movies={movieList.slice(80,85)} />
          <Row movies={movieList.slice(85,90)} />
          <Row movies={movieList.slice(90,95)} />
          <Row movies={movieList.slice(95,100)} />
        </div>
      }
    </div>
  );
};

const styles = {
  emptyListMessage: {
    color: 'white',
    fontWeight: 'bold'
  }
};

export default withStyles(styles)(List);
